import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Article(props) {
	return <div class="article_thumbnail">
		<img class="article_image" src={this.props.urlToImage}></img>
			<div class="article_text">
				<h3 class="h3">{this.props.article_title}</h3>
				<h3 class="article_category">{this.props.article_category}</h3>
				<p class="article_subtext">{this.props.article_subtext}</p>
			</div>
  		</div>;
}

var url = 'https://newsapi.org/v2/everything?' +
          'q=Apple&' +
          'from=2022-03-19&' +
          'sortBy=popularity&' +
          'apiKey=59c89082598e49e69463d95c1cedf96d';

var req = new Request(url);

fetch(req)
    .then(function(response) {
        console.log(response.json());
    })

ReactDOM.render(
	<Article urlToImage=""></Article>,
	document.getElementById('root')
  );
